Should We Run has been through many trials and changes since their last release in 2014. On November 19th, 2016, they're set to release their (yet-unnamed) sophomore effort, a much bigger and more musical record which will explore the human condition and our place in this vast experience of life.  Their hearts have always been on their sleeves, but this second album gives Should We Run a chance to show their teeth.

